import React, { Component } from "react";
import Navbar from "../components/layouts/navbar";

class Model extends Component {
  state = {};
  render() {
    return (
      <React.Fragment>
        <Navbar />
        <div className="ui text container">
          <center>
            <h1 className="warranty">Model</h1>
            <br />
          </center>
          <h3>HIGH QUALITY</h3>
          <p>
            Our new brand has a French design and standards included high
            quality products with superior guarantees as HONDA for example. We
            have selected the electrical and mechanical components with
            professionalism to ensure our users an electric bike that lasts in
            time. Their design has been studied for all climatic conditions.
            Even in case of flooded road or heavy rain, electric bikes work very
            well.
          </p>
        </div>
      </React.Fragment>
    );
  }
}

export default Model;
